import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './Home.css';
import { Link } from 'react-router-dom';
import { useLocation, useNavigate } from 'react-router-dom';
import HomeContent from './HomeContent';
import RegisCouncelling from './RegisCouncelling';
import Analysis from './Analysis';
import AboutUs from './AboutUs';
import Profile from '../assets/img/profile-user.png';
import Logo from '../assets/img/carecube.png';
import Preloader from './Preloader';
import Carousel from 'react-bootstrap/Carousel';
import ExampleCarouselImage from '../assets/img/logo.png';

const Home = () => {
  const [user, setUser] = useState(null);
  const userId = (useLocation().pathname).split('/')[2];
  const [activeButton, setActiveButton] = useState("homecontent");
  const navigate = useNavigate();

  useEffect(() => {
    const fetchUser = async () => {
      try {
        console.log("hello");
        const user = await axios.post('http://localhost:4000/getUser', {
          userId: userId
        });
        console.log("user: ", user);
        console.log(user.data.detail);
        setUser(user.data.detail);
      } catch (err) {
        console.log(err);
      }
    }
    fetchUser();
  }, [userId]);

  const handleButtonClick = (buttonName) => {
    setActiveButton(buttonName);
    if (buttonName === "logout") {
      navigate("/login");
    }
  };

  return (
    <>
      <Carousel>
        <Carousel.Item>
          <ExampleCarouselImage text="First slide" />
          <Carousel.Caption>
            <h3>First slide label</h3>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <ExampleCarouselImage text="Second slide" />
          <Carousel.Caption>
            <h3>Second slide label</h3>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <ExampleCarouselImage text="Third slide" />
          <Carousel.Caption>
            <h3>Third slide label</h3>
            <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    </>
  );
}

export default Home;
